import styled from "styled-components";

export const NavDiv = styled.div`
  display: flex;
  width: 100%;
  justify-content: space-evenly;
  background: #323232;
  padding: 10px 0;
`;

export const SubNavDiv = styled.div`
  display: flex;
  width: 100%;
  justify-content: space-evenly;
`;
